import React, { useState } from 'react';

function Resources() {
  const [resources, setResources] = useState([
    { id: 1, name: "Projector", isBooked: false },
    { id: 2, name: "Sound System", isBooked: true },
    { id: 3, name: "Conference Room", isBooked: false },
    { id: 4, name: "Microphone", isBooked: false },
    { id: 5, name: "Laptop", isBooked: true },
  ]);

  const [resourceName, setResourceName] = useState('');

  // Handle adding a new resource
  const handleAddResource = (e) => {
    e.preventDefault();
    if (resourceName) {
      const newResource = {
        id: Date.now(),
        name: resourceName,
        isBooked: false,
      };
      setResources([...resources, newResource]);
      setResourceName('');
    } else {
      alert("Please enter a resource name.");
    }
  };

  // Handle booking a resource
  const handleBookResource = (id) => {
    setResources(resources.map(resource =>
      resource.id === id ? { ...resource, isBooked: true } : resource
    ));
  };

  // Handle releasing a resource
  const handleReleaseResource = (id) => {
    setResources(resources.map(resource =>
      resource.id === id ? { ...resource, isBooked: false } : resource
    ));
  };

  // Separate available and booked resources
  const availableResources = resources.filter(resource => !resource.isBooked);
  const bookedResources = resources.filter(resource => resource.isBooked);

  return (
    <section className="min-h-screen bg-cover bg-center bg-gray-900 text-white p-10" style={{ backgroundImage: "url('/path-to-eventify-background.jpg')" }}>
      <h2 className="text-4xl font-bold text-center mb-10">Resource Management</h2>

      {/* Add Resource Form */}
      <form onSubmit={handleAddResource} className="mb-8 bg-gray-800 p-6 rounded-lg shadow-lg max-w-md mx-auto">
        <h3 className="text-2xl font-semibold mb-4 text-center">Add New Resource</h3>
        <input 
          type="text" 
          placeholder="Resource Name" 
          className="w-full px-4 py-2 mb-4 border rounded-md focus:outline-none text-black"
          value={resourceName}
          onChange={(e) => setResourceName(e.target.value)}
        />
        <button 
          type="submit"
          className="w-full bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600 transition duration-300"
        >
          Add Resource
        </button>
      </form>

      {/* Available Resources */}
      <div className="mb-8">
        <h3 className="text-3xl font-semibold text-green-400 text-center mb-4">Available Resources</h3>
        {availableResources.length === 0 ? (
          <p className="text-center text-gray-300">No available resources.</p>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {availableResources.map((resource) => (
              <div key={resource.id} className="bg-gray-800 p-6 rounded-lg shadow-lg text-center">
                <h3 className="text-2xl font-semibold mb-2">{resource.name}</h3>
                <button 
                  onClick={() => handleBookResource(resource.id)}
                  className="mt-4 bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-600 transition duration-300"
                >
                  Book
                </button>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Booked Resources */}
      <div>
        <h3 className="text-3xl font-semibold text-red-400 text-center mb-4">Booked Resources</h3>
        {bookedResources.length === 0 ? (
          <p className="text-center text-gray-300">No booked resources.</p>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {bookedResources.map((resource) => (
              <div key={resource.id} className="bg-gray-800 p-6 rounded-lg shadow-lg text-center">
                <h3 className="text-2xl font-semibold mb-2">{resource.name}</h3>
                <button 
                  onClick={() => handleReleaseResource(resource.id)}
                  className="mt-4 bg-red-500 text-white px-4 py-2 rounded-md hover:bg-red-600 transition duration-300"
                >
                  Release
                </button>
              </div>
            ))}
          </div>
        )}
      </div>
    </section>
  );
}

export default Resources;
